import React from "react";

const Modal = ({revele, cache}) => revele ?(
    <React.Fragment>
        <div className="overlay"/>
        <div className="wrapper">
            <div className="modal">
                <button type="button" className="close" onClick={cache}>
                    <span>&times;</span>
                    <p>Modale</p>
                </button>
            </div>
        </div>
    </React.Fragment>
) : null;
export default Modal;
